var players;function SearchPlayers(b){var a=$("#playerMatch");a.empty();if(b.length<2){return}$.each(players,function(c,d){if(d.Name.toLowerCase().indexOf(b.toLowerCase())>-1){a.append($("<li></li>").append($("<a></a>").attr("href","/Admin/Players/Edit/"+d.Id).html(d.Name+" ("+d.Team+")")))}})}$().ready(function(){$.getJSON("/Admin/Players/GetPlayers",function(a){if(a.length==0){return}players=a;$("#Player_Surname").keyup(function(){SearchPlayers($("#Player_Surname").val())})})});